from pybricks.hubs import PrimeHub
from pybricks.parameters import Direction, Port, Stop
from pybricks.pupdevices import Motor
from pybricks.robotics import DriveBase

# Set up all devices.
prime_hub = PrimeHub()
left = Motor(Port.A, Direction.COUNTERCLOCKWISE)
right = Motor(Port.B, Direction.CLOCKWISE)
front = Motor(Port.E, Direction.CLOCKWISE)
top = Motor(Port.F, Direction.COUNTERCLOCKWISE)
drive_base = DriveBase(left, right, 81, 99)


# The main program starts here.
drive_base.use_gyro(True)
front.control.limits(torque=450)
drive_base.settings(straight_speed=400)
drive_base.turn(20)
drive_base.straight(-330)
drive_base.turn(-20)
drive_base.straight(-300)
front.run_angle(500, -90, Stop.NONE)
front.run_angle(500, 90)
drive_base.straight(-80)
front.run_angle(500, 120, Stop.NONE)
front.run_angle(500, -45)
drive_base.straight(200)
front.run_angle(500, -45)
drive_base.turn(-35)
drive_base.straight(100)
drive_base.turn(-55)
drive_base.settings(straight_speed=200)
drive_base.straight(185)
drive_base.settings(straight_speed=450)
drive_base.straight(-100)
drive_base.turn(110)
drive_base.straight(500)
